window.bookSummaryJSON = "<p><b>From </b><b><i>USA Today </i></b><b>best-selling author Brett Battles comes the third book in his exciting Excoms thriller series.</b></p> <p>Ananke and the rest of the Excoms team thought they would get a little bonding time to kick back and relax. But the world has different ideas.</p> <p>After the organization that they work for discovers that over 100 prisoners from a now dismantled human trafficking operation are missing, the team is sent out to find them and bring them back.</p> <p>With few clues, they must follow a trail that leads from Washington State to Panama and beyond. And when they reach the end, what they find is far beyond anything they ever expected.&nbsp;</p> <p>Itâ€™ll take everyone working at the top of their game, but even that might not be enough.</p>"; 
